    monkeyPatchAutocomplete: function monkeyPatchAutocomplete() {

        // don't really need this, but in case I did, I could store it and chain
        var oldFn = $.ui.autocomplete.prototype._renderItemData;

        $.ui.autocomplete.prototype._renderItemData = function (ul, item) {
            var re = new RegExp("^" + this.term);
            var t = item.label.replace(re, "<span style='font-weight:bold;'>" + this.term + "</span>");
            return $("<li></li>").data("item.autocomplete", item).append(t).appendTo(ul);
        };
    },


    compressArray: function compressArray(original) {

        var compressed = [];
        // make a copy of the input array
        var copy = original.slice(0);

        // first loop goes over every element
        for (var i = 0; i < original.length; i++) {

            var myCount = 0;
            // loop over every element in the copy and see if it's the same

            for (var w = 0; w < copy.length; w++) {
                if (original[i] == copy[w]) {
                    // increase amount of times duplicate is found
                    myCount++;
                    // sets item to undefined
                    delete copy[w];
                }
            }

            if (myCount > 0) {

                var a = new Object();

                if (a !== undefined) {
                    a.value = original[i].value;
                }

                a.count = myCount;
                compressed.push(a);
            }
        }

        return compressed;
    },

